/*Custom*/
$(document).ready(function(){
    let anim = true;
    let vw = $(window).width();
    let vh = $(window).height();
    let secCount = $('section').length + $('[data-id]').length;
    let fullpage = $('#wrap');
    let currSlide = 1;
    let speed = 1200;
    let scrollbar = {};
    let scrollbarContainer = {};

    clearScroll();
     
    

    function mob(){
        if(vw <= 1024) {
            return true;
        } else {
            return false;
        }
    }





    if(mob()){
        $("#wrap").swipe( {
            swipeStatus:swipeEvent
        });


        function swipeEvent(event, phase, direction, distance){

            let threshold = 30;
            currSlide = parseInt($('body').attr('data-slide'));
            if(anim && !$('body').hasClass('inner')){
                
                if(direction == "down" && distance > threshold){
                    anim = false; 
                    if(currSlide!=0) currSlide-=1;
                } 
                if(direction == "up" && distance > threshold){
                    anim = false; 
                    if(currSlide < secCount-1) currSlide+=1;
                }
                $('body').attr('data-slide', currSlide);
                  
                setTimeout(function(){
                    anim = true;    
                },800); 
            }

        } 

    }
















    
    function clearScroll(){
        $('.dog-item').addClass('clear')
                      .scrollTop(0)
                      .removeClass('clear');
        $('.bar').attr('style','');
        $('.anim').removeClass('anim');
    }




    $('#wrap').on('mousewheel', function(e){
        currSlide = parseInt($('body').attr('data-slide'));
		if(!mob() && anim && !$('body').hasClass('inner') ){
            anim = false; 
            if(e.deltaY > 0){
                if(currSlide!=0) currSlide-=1;
            } else {
                if(currSlide < secCount-1) currSlide+=1;
            }
            $('body').attr('data-slide', currSlide);
            currSlide>=4 ? speed = 700 : speed = 1200;
            setTimeout(function(){
                anim = true;    
            },speed); 
        }
    })




    $('#menu').on('click',function(){
        let cont = $('.dog-item.active');
        $('body').removeClass('inner') 
                 .removeClass('show-h2-new')
        if(cont.hasClass('scrolled')){
            $('body').addClass('closed');
            setTimeout(function(){
                $('body').removeClass('closed');
                         
                scrollbar.destroy();
                cont.removeClass('scrolled')
                    .removeClass('active');
                clearScroll();
                $('.h2-wrap-new').remove();
             },430)

             setTimeout(function(){
                $('body').removeClass('to-inner')
                         .addClass('main');
             },300)
        } else {
            scrollbar.scrollTo(0, 0, 300);
            $('body').addClass('animation');
            cont.removeClass('active');

            setTimeout(function(){
                $('body').removeClass('animation');
                scrollbar.destroy();
                $('.h2-wrap-new').remove();
                $('body').removeClass('to-inner')
                         .addClass('main');
            },1000);

        }




        


    })


  // Переход к следующей статье 
    $('.title-next').on('click',function(){
        let article = $(this).attr('data-link');
        let oldArticle = $('.dog-item.active');
        let newArticle = $('.dog-item[data-id="'+article+'"]');
        scrollbarContainer = newArticle[0];
        oldArticle.css({'opacity':'0', 'transition':'.3s'});
        newArticle.css('display','none')
                  .addClass('no-transitions')
                  .addClass('active')
                  .fadeIn(400);
        $('body').attr('data-slide', 2 + article*1);

        setTimeout(function(){
            oldArticle.attr('style','')
                      .removeClass('scrolled')
                      .removeClass('active');
            Scrollbar.destroyAll();

            newArticle.attr('style','')
                      .removeClass('no-transitions');

            clearScroll();

            scrollbar = Scrollbar.init(scrollbarContainer,{});
            scrollbar.addListener((status) => {
                progressBar(newArticle,status);
                newArticle.find('.img-par').each(function(){
                    parallaxInContainer($(this));
                })
                newArticle.find('.fade-up,.fade-zoom-up').each(function(){
                    startAnimation($(this));
                })
            });
        },430)
    })


    // Переход к статье из меню
    $('.dog-item-outher>.img-main, .dog-item-outher>h2').on('click',function(){
        let activePage = $(this).closest('.dog-item');
        scrollbarContainer = activePage[0];
        if(!activePage.hasClass('active')){
            clearScroll();
            activePage.addClass('active');
            $('body').addClass('inner')
                     .addClass('animation')
                     .removeClass('main')
                    

       
                let h2 = activePage.find('.h2-wrap').html();
                
                $('.dog-item-outher').append('<div class="h2-wrap-new">'+h2+'</div>')
                
        
                


            setTimeout(function(){
                $('body').addClass('show-h2-new');
            },501);
            setTimeout(function(){
               $('body').removeClass('animation');
               $('body').addClass('to-inner');
                scrollbar = Scrollbar.init(scrollbarContainer,{});
                scrollbar.addListener((status) => {
                    progressBar(activePage,status);
                    activePage.find('.img-par').each(function(){
                        parallaxInContainer($(this));
                    })
                    activePage.find('.fade-up,.fade-zoom-up').each(function(){
                        startAnimation($(this));
                    })
                });
            },1000)


        }
    })


    let progressLength = $('.bar')[0].getTotalLength();


    function progressBar(obj,status){
        let scrTop = status.offset.y;
        let heightContent = scrollbar.getSize().content.height;
        let progressPercent = (scrTop * 100) / (heightContent - vh);
        let progressPath = progressLength - progressLength * (progressPercent / 100);
        if(!obj.hasClass('scrolled') && progressPercent > 13){
            obj.addClass('scrolled');
        } 
        if(obj.hasClass('scrolled') && progressPercent < 13){
            obj.removeClass('scrolled');
        }
        if(progressPath>0) {
            $('.bar').css('stroke-dashoffset',progressPath)
        }
    }


    function startAnimation(obj){
        if(elementInViewport(obj[0])[0]){
            let k = ((elementInViewport(obj[0])[1].top + elementInViewport(obj[0])[1].height) * 100)/(elementInViewport(obj[0])[1].height+vh);
            if(k<=98 && !obj.hasClass('anim')) { 
                obj.addClass('anim');
            }
        }
    }

    function parallaxInContainer(obj){
        if(elementInViewport(obj[0])[0]){
            let imgWrapH = obj.parent().height();
            let imgH = obj.find('img').height();
            let k = ((elementInViewport(obj[0])[1].top + elementInViewport(obj[0])[1].height) * 100)/(elementInViewport(obj[0])[1].height+vh);
            let scrollDestination = -k*((imgH - imgWrapH)/100);
            obj.find('img').css('transform','translate(0px,' + scrollDestination + 'px)'); 
        }
    }


    $('.btn-down').on('click',function(){
        $('body').attr('data-slide', 2);
    })


    $('.owl-carousel').owlCarousel({
        loop:true,
        nav:true,
        dots:false,
        items:1,
        smartSpeed:650
    });


    function elementInViewport(el){  
        var bounds = el.getBoundingClientRect();
        return (
            [(bounds.top + bounds.height > 0) && (window.innerHeight - bounds.top > 0),bounds]
        );
    }



// Добавление фона при ресайзе
    let rtime;
    let timeout = false;
    let delta = 100;
    $(window).resize(function() {
        rtime = new Date();
        if (timeout === false) {
            timeout = true;
            $('body').append('<div id="shadow"></div>')
            setTimeout(resizeend, delta);
        }
    });
    
    function resizeend() {
        if (new Date() - rtime < delta) {
            setTimeout(resizeend, delta);
        } else {
            timeout = false;
            $('#shadow').remove();
        }               
    }



    





});


  
  
 






